    const { books } = useContext(BooksContext);


    const renderedBooks = books.map((book) => {
        return <BookShow onEdit={onEdit} onDelete={onDelete} key={book.id} book={book} />;
    });


    return (

        <div className='book-list'>
            {renderedBooks} 
        
        </div>
    )
}
